import React, {useState,useEffect} from "react";


const Home = ()=>{

   let data;
    const submit = async ()=>{
        await fetch("/api/Dummy/")
        .then(response=>response.json())
        .then(d => data=d);
        console.log(data);
        
    };

    return (
        <div>Home
        <button onClick={submit}>Click</button>
        </div>
    )
};

export default Home;
